    letter of the FEC dated September 21, 2010.  The $1,000.00 contribution from Joseph
    Davis was allocated to the Primary Election thorough clerical error. It should
    have been designated to the General Election. Mr. Davis has redisignated such
    amount to retirement of primary election debt. The amount of debt will be documented
